import logo from './avacado.png'
import Button from '@material-ui/core/Button'
import EditEmployee from './EditEmployee.js'

const addEmployee = () => {
    <Link to='/editEmployee'/>
}

const Home = () => {
    return (
        <div>
            <img src={logo} className='App-logo' alt='logo' />
            <div>
                <Button variant='contained' color='secondary' style={{marginRight: '1rem'}} onClick={<EditEmployee/>}>Add Employee</Button>
                <Button variant='contained' color='primary' >Click</Button>
            </div>
        </div>
    )
}

export default Home
